} where cargoHostTarget has the same meaning as coming from a pkgsHostTarget. And cargoBuildBuild has the same meaning as coming from a pkgsBuildBuild. To override the toolchain for a specific package, you will need to set an override for both the dependencies and the main package derivation: let toolchainOverride = old: { /* ... */ };
