The override system plays an important role when packaging software with dream2nix. Overrides are the only way to express package specific logic in dream2nix. This serves the purpose of strictly separating: - generic logic (builders) - specific logic (overrides) - data (dream-lock.json) To optimize for scalable workflows, the structure of dream2nix overrides differs from the ones seen in other projects. dream2nix overrides have the following properties: referenceable : each override is assigned to a key through which it can be referenced. This allows for better inspection, selective debugging, replacing, etc. conditional : each override can declare a condition, so that the override only applies when the condition evaluates positively. attribute-oriented : The relevant parameters are attributes, not override functions. dream2nix will automatically figure out which underlying function (eg. override, overrideAttrs, ...) needs to be called to update each given attribute. The user is not confronted with this by default. Each subsystem in dream2nix like nodejs or python manages its overrides in a separate directory to avoid package name collisions. dream2nix supports packaging different versions of the same package within one repository. Therefore conditions are used to make overrides apply only to certain package versions. Currently a collection of overrides is maintained at dream2nix/overrides values can either be declared directly via # "${pname}" = {
# "${overrideName}" = {
# ...
# `attrName` will get overriden with `newValue`
# ${attrName} = newValue; # ...
# };
# };
# or via function that takes the oldAttrs and returns newAttrs depending on the old ones. # # "${pname}" = {
# "${overrideName}" = {
# ...
# overrideAttrs = oldAttrs: {
# ${attrName} = ...;
# };
# ...
# };
# };
